// sw.min.js

// Événement d'installation : se déclenche lorsque le service worker est installé.
self.addEventListener('install', function(event) {
    console.log('Service Worker installé');
  });
  
  // Événement d'activation : se déclenche lorsque le service worker est activé.
  self.addEventListener('activate', function(event) {
    console.log('Service Worker activé');
  });
  
  // Événement fetch : se déclenche lorsque le navigateur récupère une ressource.
  self.addEventListener('fetch', function(event) {
    console.log('Ressource récupérée : ', event.request.url);
    // Vous pouvez mettre en œuvre la mise en cache des ressources ou d'autres
    // logiques de récupération de réseau ici.
  });
  